import styled from "styled-components";


export const HeaderContainer = styled.div `

width:100%;
z-index:2;
position:fixed;
top:0;
left:0;

background:rgba(0, 0, 0, 0.7);

height:80px;

line-height:80px;


button {
    margin-left: auto;
}
`

export const OptionsDiv = styled.div `

background: #313131;
width:400px;
height:400px;

position: absolute;
left
`
